(8, 3, '[TÍNH NĂNG] CÁCH SỞ HỮU TƯỚNG', 'Có 3 loại tìm kiếm: Nghe ngóng - Dò hỏi - Tiến cử (tỉ lệ ra các loại tướng khác nhau)', '<p><strong>1. T&igrave;m kiếm v&agrave; chi&ecirc;u mộ tướng</strong></p>\r\n\r\n<p>Mỗi loại t&igrave;m kiếm sẽ ti&ecirc;u tốn 1 lượng tiền hoặc 1 vật phẩm (tương ứng). Cụ thể như sau:</p>\r\n\r\n<ul>\r\n	<li>Nghe ng&oacute;ng mua được bằng bạc</li>\r\n	<li>D&ograve; hỏi v&agrave; tiến cử phải mua bằng V&agrave;ng.</li>\r\n	<li>Gi&aacute; trị của v&eacute; t&igrave;m kiếm quyết định tỉ lệ tiếp cận nh&acirc;n vật lịch sử.</li>\r\n	<li>Tỉ lệ để nh&igrave;n thấy nh&acirc;n vật lịch sử khi thực hiện t&iacute;nh năng t&igrave;m kiếm.</li>\r\n	<li>H&agrave;ng tuần hệ thống lựa chọn ngẫu nhi&ecirc;n c&aacute;c tướng trong danh s&aacute;ch tướng để cho ph&eacute;p Ch&uacute;a c&ocirc;ng c&oacute; thể t&igrave;m kiếm hoặc chi&ecirc;u mộ. Khi Ch&uacute;a c&ocirc;ng đ&atilde; t&igrave;m thấy v&agrave; chi&ecirc;u mộ hết số lượng tướng c&oacute; thể chi&ecirc;u mộ th&igrave; t&iacute;nh năng t&igrave;m kiếm sẽ th&ocirc;ng b&aacute;o cho người chơi trở lại v&agrave;o tuần tiếp theo.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. Mua tướng trong Tửu qu&aacute;n:</strong> Ch&uacute;a c&ocirc;ng c&oacute; thể d&ugrave;ng V&agrave;ng hoặc bạc để mua tướng</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/upload/images/danh%20s%C3%A1ch%20t%C6%B0%E1%BB%9Bng.jpg\" style=\"height:281px; width:500px\" /></p>\r\n\r\n<p><strong>3. Nhận từ sự kiện</strong>: Ch&uacute;a c&ocirc;ng&nbsp; cũng c&oacute; thể nhận được tướng khi tham gia sự kiện đặc biệt.</p>\r\n\r\n<p>Sau khi đ&atilde; sở hữu c&aacute;c tướng muốn c&oacute;, Ch&uacute;a c&ocirc;ng c&oacute; thể tăng cấp, chuyển sinh, cải tiến,..,để tăng c&aacute;c chỉ số cho tướng.</p>\r\n', 'game chiến thuật, game chien thuat mobile, game nhap vai, game hành động, game chiến lược', 'slideto41.png', 'tinh-nang-cach-so-huu-tuong', 0, 72, 1, 1, '2020-03-03 11:25:22'),
(9, 1, 'Thành Chiến Mobile - Cực Phẩm Game Chiến Thuật Thuần Việt ', '', '<p><span style=\"font-size:14px\"><a href=\"https://thanhchienmobile.vn/\" style=\"text-align: justify;\" title=\"Thành Chiến Mobile\">Th&agrave;nh Chiến Mobile</a>&nbsp;l&agrave; game chiến thuật thời gian thực 24/24, t&aacute;i hiện lại từ việc c&aacute;c vị tướng t&agrave;i bảo vệ th&agrave;nh tr&igrave; khai ph&aacute;, mở rộng l&atilde;nh thổ một c&aacute;ch ch&acirc;n thực v&agrave; sắc n&eacute;t nhất. Thanh Chien Mobile l&agrave; d&ograve;ng&nbsp; game chien thuat SLG do ch&iacute;nh người Việt sản xuất n&ecirc;n từ những đường n&eacute;t đồ họa đến c&aacute;c t&iacute;nh năng đều mang đậm phong c&aacute;ch thuần Việt để người chơi cảm thấy th&iacute;ch th&uacute; nhất kh&aacute;c hẳn so với c&aacute;c d&ograve;ng game tam quốc hiện nay.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img alt=\"thành chiến mobile, thanh chien mobile, game chien thuat, game chiến thuật, game nhập vai, game hành động, game tam quoc, game thủ thành, game công thành, game chiến thuật thời gian thực, game chiến lược, game chien thuat online hay nhat, game online hay nhất hiện nay\" src=\"/upload/images/GIOITHIEUGAME.png\" style=\"height:321px; width:600px\" title=\"Thành Chiến Mobile - Cực Phẩm Game Chiến Thuật Thuần Việt \" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Th&agrave;nh Chiến Mobile t&iacute;ch hợp những kĩ năng như chiến thuật sắp xếp đội h&igrave;nh, khả năng chi&ecirc;u mộ tướng t&agrave;i. Mỗi trận đấu l&agrave; một lần so k&egrave; chiến thuật c&acirc;n n&atilde;o của người chơi. Tất cả đều c&oacute; thể ảnh hưởng đến cục diện trận đấu, người chơi cũng c&oacute; thể h&oacute;a th&acirc;n th&agrave;nh những vị tướng với sức mạnh phi thường như game nhập vai.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>C&aacute;c t&iacute;nh năng đặc sắc trong game:</strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"color:#FF0000\"><strong>CHI&Ecirc;U MỘ DANH TƯỚNG &ndash; TUYỂN CHỌN BINH CHỦNG</strong></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Th&agrave;nh Chiến Mobile sở hữu bộ tướng đa dạng được chia th&agrave;nh nhiều binh chủng đặc như: Cung Binh, Ph&aacute;o Binh, Bộ Binh, Tượng Binh, Kỵ Binh. Người chơi c&oacute; thể thoải m&aacute;i lựa chọn c&aacute;c chiến thuật để ph&ugrave; hợp với từng trận đ&aacute;nh ri&ecirc;ng. Mỗi tướng đều c&oacute; những chất rất ri&ecirc;ng biệt v&agrave; c&oacute; thể chi&ecirc;u mộ binh l&iacute;nh theo binh chủng.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img alt=\"thành chiến mobile, thanh chien mobile, game chien thuat, game chiến thuật, game nhập vai, game hành động, game tam quoc, game thủ thành, game công thành, game chiến thuật thời gian thực, game chiến lược, game chien thuat online hay nhat, game online hay nhất hiện nay\" src=\"/upload/images/gt-tuong.png\" style=\"height:333px; width:600px\" title=\"Thành Chiến Mobile - Cực Phẩm Game Chiến Thuật Thuần Việt \" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"color:#FF0000\"><strong>KHAI PH&Aacute; L&Atilde;NH THỔ &ndash; X&Acirc;Y DỰNG TH&Agrave;NH TR&Igrave;</strong></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Người chơi sẽ bắt đầu khai ph&aacute;, n&acirc;ng cấp to&agrave;n bộ l&atilde;nh thổ của m&igrave;nh, sau đ&oacute; sẽ đi c&ocirc;ng th&agrave;nh mở rộng l&atilde;nh địa xưng đế x&acirc;y cho m&igrave;nh th&agrave;nh tr&igrave; ki&ecirc;n cố v&agrave; mạnh nhất. Đ&oacute; l&agrave; những bước cơ bản trong chiến lược game thu thanh. Từ việc trồng trọt đến khai th&aacute;c t&agrave;i nguy&ecirc;n nhằm n&acirc;ng cao sức mạnh của bản th&acirc;n. Th&agrave;nh tr&igrave; sẽ được x&acirc;y dựng trong thời gian thực ng&agrave;y v&agrave; đ&ecirc;m, 24/24 như rise of kingdoms.</span></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"thành chiến mobile, thanh chien mobile, game chien thuat, game chiến thuật, game nhập vai, game hành động, game tam quoc, game thủ thành, game công thành, game chiến thuật thời gian thực, game chiến lược, game chien thuat online hay nhat, game online hay nhất hiện nay\" src=\"/upload/images/BN-gioithieuthanh.png\" style=\"height:333px; width:600px\" title=\"Thành Chiến Mobile - Cực Phẩm Game Chiến Thuật Thuần Việt \" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"color:#FF0000\"><strong>BANG HỘI GẮN KẾT &ndash; SỐNG CHẾT C&Oacute; NHAU</strong></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Tham gia lien minh bang hội sẽ trải nghiệm t&iacute;nh năng đặc sắc: đ&aacute;nh boss nhận item hiếm, Bang hội chiến, L&ocirc;i đ&agrave;i chiến li&ecirc;n server.&nbsp;Đặc sắc, dễ chơi, c&ocirc;ng bằng v&agrave; phần thưởng khủng ch&iacute;nh l&agrave; yếu tố khiến người chơi bắt buộc phải tham gia. Đ&oacute; cũng ch&iacute;nh l&agrave; những n&eacute;t độc đ&aacute;o trong tựa game chiến thuật thời gian thực n&agrave;y.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img alt=\"thành chiến mobile, thanh chien mobile, game chien thuat, game chiến thuật, game nhập vai, game hành động, game tam quoc, game thủ thành, game công thành, game chiến thuật thời gian thực, game chiến lược, game chien thuat online hay nhat, game online hay nhất hiện nay\" src=\"/upload/images/BN%20gioi%20thieu.jpg\" style=\"height:600px; width:600px\" title=\"Thành Chiến Mobile - Cực Phẩm Game Chiến Thuật Thuần Việt \" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Một n&eacute;t kh&aacute;c của tựa game chiến thuật đ&oacute; l&agrave; t&iacute;nh năng tăng cấp nh&acirc;n vật. Gần như mọi trang bị, nguy&ecirc;n liệu, vật phẩm, người chơi c&oacute; thể sở hữu được th&ocirc;ng qua việc tăng cấp. Để c&oacute; thể gi&uacute;p người chơi tăng cấp nhanh th&igrave; game Th&agrave;nh Chiến Mobile c&oacute; tổ chức c&aacute;c chuỗi hoạt động, nhiệm vụ phong ph&uacute; như: Tham gia chat thế giới, c&aacute;i tiến tướng, thu thuế,&hellip;.</span></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"thành chiến mobile, thanh chien mobile, game chien thuat, game chiến thuật, game nhập vai, game hành động, game tam quoc, game thủ thành, game công thành, game chiến thuật thời gian thực, game chiến lược, game chien thuat online hay nhat, game online hay nhất hiện nay\" src=\"/upload/images/NHIEMVU.png\" style=\"height:333px; width:600px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Khi nhắc đến c&aacute;c t&iacute;nh năng của game, ngo&agrave;i c&aacute;c phần quen thuộc, Th&agrave;nh Chiến Mobile c&ograve;n nhiều t&iacute;nh năng kh&aacute;c để gi&uacute;p người chơi thỏa ch&iacute; kh&aacute;m ph&aacute; game như: Thăm nh&agrave;, B&aacute;o th&ugrave;, Cấp danh hiệu v&otilde; đ&agrave;i,&hellip;..</span></p>\r\n\r\n<p><span style=\"font-size:14px\">Về c&aacute;ch tải game, sản phẩm đ&atilde; ra mắt 02 phi&ecirc;n bản d&agrave;nh l&agrave; Android v&agrave; iOs.</span></p>\r\n\r\n<p><span style=\"color:rgb(201, 198, 198); font-family:tahoma,arial,helvetica,sans-serif; font-size:14px\">➡️ </span><span style=\"font-family:tahoma,arial,helvetica,sans-serif; font-size:14px\">Link tải game tr&ecirc;n IOS: <a href=\"https://bitly.com.vn/KjbXf\">TẠI Đ&Acirc;Y</a>.</span><br />\r\n<span style=\"color:rgb(201, 198, 198); font-family:tahoma,arial,helvetica,sans-serif; font-size:14px\">➡️ </span><span style=\"font-family:tahoma,arial,helvetica,sans-serif; font-size:14px\">Link tải game tr&ecirc;n Android:</span><span style=\"color:rgb(201, 198, 198); font-family:tahoma,arial,helvetica,sans-serif; font-size:14px\">&nbsp;</span><span style=\"font-family:tahoma,arial,helvetica,sans-serif; font-size:14px\"><a href=\"http://https://bitly.com.vn/p1vDl\">TẠI Đ&Acirc;Y</a>.</span></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:14px\">BQT Th&agrave;nh Chiến Mobile!</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:14px\">Tr&acirc;n trọng!</span></strong></p>\r\n\r\n<p><span style=\"color:#FF0000\"><span style=\"font-size:14px\"><strong>Th&agrave;nh Chiến Mobile &ndash; Game Chiến Thuật Thuần Việt</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px\">---Youtube Th&agrave;nh Chiến Mobile:&nbsp;&nbsp;<a href=\"https://bitly.com.vn/LouRG\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none; outline: none;\">Xem tại đ&acirc;y</a></span></p>\r\n\r\n<p><span style=\"font-size:14px\">---Fanpage Th&agrave;nh Chiến Mobile :&nbsp;<a href=\"https://www.facebook.com/thanhchienmobile/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none; outline: none;\">Tham gia tại đ&acirc;y</a></span></p>\r\n\r\n<p><span style=\"font-size:14px\">---Cộng đồng Th&agrave;nh Chiến Mobile :&nbsp;<a href=\"https://bitly.com.vn/10Ml0\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none; outline: none;\">Gia nhập ngay</a></span></p>\r\n', 'thanhchienmobile, game chiến thuật, game chien thuat mobile, game nhap vai, game nhập vai chiến thuật', '1.png', 'thanh-chien-mobile---cuc-pham-game-chien-thuat-thuan-viet', 0, 221, 1, 1, '2020-05-14 16:26:06'),
(10, 1, '[ HƯỚNG DẪN ] ĐĂNG KÍ ,ĐĂNG NHẬP TÀI KHOẢN ', 'Hướng dẫn tất cả các bước đăng kí ,đăng nhập tài khoản game dành cho tân thủ', '<p><a href=\"https://thanhchienmobile.vn/\">Game chiến thuật</a>&nbsp; l&agrave; một tựa game bắt đầu s&ocirc;i động&nbsp; trở lại&nbsp; trong thị trường c&aacute;c tr&ograve; chơi điện tử hiện nay, khi c&aacute;c bạn đ&atilde; ch&aacute;n với c&aacute;c tựa game cần nhịp độ tiết tấu cao ,kết th&uacute;c nhanh ch&oacute;ng ở c&aacute;c trận đ&aacute;nh. Thanhchienmobile ,tựa game chiến thuật đỉnh cao &aacute;p dụng chiến thuật x&acirc;y dựng đội h&igrave;nh chiến đấu mạnh mẽ t&ugrave;y v&agrave;o độ tinh qu&aacute;i của bạn</p>\r\n\r\n<p>Để đăng nhập v&agrave;o game điều kiện đầu ti&ecirc;n bạn phải c&oacute; một t&agrave;i khoản, vậy bạn đ&atilde; biết c&aacute;ch đăng k&yacute; t&agrave;i khoản như thế n&agrave;o chưa? Nếu chưa th&igrave; h&atilde;y d&agrave;nh &iacute;t thời gian qu&yacute; b&aacute;u c&ugrave;ng dạo bước t&igrave;m hiểu chi tiết b&agrave;i viết n&agrave;y. Hướng dẫn&nbsp;c&aacute;ch đăng k&yacute; v&agrave; cập nhật t&agrave;i khoản Thanhchienmobile miễn ph&iacute; v&agrave; đơn giản nhất.</p>\r\n\r\n<p><strong>1,Đăng k&iacute; t&agrave;i khoản mới :</strong></p>\r\n\r\n<p><em>&nbsp;Khi v&agrave;o game sẽ hiển thị giao diện:</em></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"thành chiến mobile, thanh chien mobile, game chien thuat, game chiến thuật, game nhập vai, game hành động, game tam quoc, game thủ thành, game công thành, game chiến thuật thời gian thực, game chiến lược, game chien thuat online hay nhat, game online hay nhất hiện nay\" src=\"/upload/images/anh03(1).jpg\" style=\"height:282px; width:500px\" /></p>\r\n\r\n<p>C&oacute; hai h&igrave;nh thức đăng k&iacute; game đ&oacute; l&agrave;: đăng k&iacute; tạo t&agrave;i khoản bằng th&ocirc;ng tin người chơi tự nhập, đăng k&iacute; bằng t&agrave;i khoản facebook.</p>\r\n\r\n<p><strong>- Đăng k&iacute; bằng t&agrave;i khoản facebook:</strong></p>\r\n\r\n<p>+ Nếu tr&ecirc;n m&aacute;y người chơi đ&atilde; đăng nhập t&agrave;i khoản facebook sẵn th&igrave; người chơi chỉ việc click v&agrave;o biểu tượng facebook hệ thống sẽ tự động kết nối để đăng nhập v&agrave;o game.</p>\r\n\r\n<p>+ Nếu tr&ecirc;n m&aacute;y người chơi chưa đăng nhập facebook hệ thống sẽ hiển thị sang giao diện đăng nhập facebook để người chơi đăng nhập facebook sau đ&oacute; sẽ kết nối với game.</p>\r\n\r\n<p><strong><em>*</em></strong><strong><em> Đăng k&iacute; thường:</em></strong></p>\r\n\r\n<p>Để đăng k&iacute; t&agrave;i khoản thường người chơi click v&agrave;o button đăng k&iacute; sẽ hiển thị popup để nhập c&aacute;c th&ocirc;ng tin. Người chơi nhập th&ocirc;ng tin theo c&aacute;c bước:</p>\r\n\r\n<p><em>+ Giao diện đăng k&yacute; </em></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"thành chiến mobile, thanh chien mobile, game chien thuat, game chiến thuật, game nhập vai, game hành động, game tam quoc, game thủ thành, game công thành, game chiến thuật thời gian thực, game chiến lược, game chien thuat online hay nhat, game online hay nhất hiện nay\" src=\"/upload/images/anh%2004.jpg\" style=\"height:282px; width:500px\" /><br />\r\n<em>Đăng k&iacute; t&agrave;i khoản&nbsp;</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>+ Bước 1: Nhập t&agrave;i khoản: T&ecirc;n t&agrave;i khoản bắt buộc bao gồm cả chữ v&agrave; số, kh&ocirc;ng chứa k&yacute; tự đặc biệt, tối thiểu 6 k&yacute; tự v&agrave; tối đa l&agrave; 20 k&yacute; tự.</p>\r\n\r\n<p>+ Bước 2: Nhập mật khẩu: Mật khẩu bắt buộc bao gồm cả chữ v&agrave; số, tối thiểu 6 k&yacute; tự v&agrave; tối đa 20 k&yacute; tự. Ch&uacute; &yacute; mật khẩu kh&ocirc;ng được dễ đo&aacute;n nếu kh&ocirc;ng sẽ kh&ocirc;ng an to&agrave;n cho t&agrave;i khoản.</p>\r\n\r\n<p>+ Bước 3: Nhập lại mật khẩu: Nhập lại mật khẩu tr&ugrave;ng với mật khẩu đ&atilde; đặt trước đ&oacute;.</p>\r\n\r\n<p>+ Bước 4: Nhập số điện thoại: C&oacute; thể nhập hoặc kh&ocirc;ng</p>\r\n\r\n<p><strong>2,Đăng nhập v&agrave;o game&nbsp;</strong></p>\r\n\r\n<p>Sau khi đăng k&yacute; th&agrave;nh c&ocirc;ng, m&agrave;n h&igrave;nh load về m&agrave;n h&igrave;nh đăng nhập với t&agrave;i khoản người chơi đ&atilde; đăng k&yacute;:</p>\r\n\r\n<p><em>+ Giao diện đăng nhập</em></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"thành chiến mobile, thanh chien mobile, game chien thuat, game chiến thuật, game nhập vai, game hành động, game tam quoc, game thủ thành, game công thành, game chiến thuật thời gian thực, game chiến lược, game chien thuat online hay nhat, game online hay nhất hiện nay\" src=\"/upload/images/ok.jpg\" style=\"height:283px; width:500px\" /></p>\r\n\r\n<p>Khi đ&atilde; c&oacute; t&agrave;i khoản đăng k&iacute; lần sau v&agrave;o game người chơi chỉ việc đăng nhập bằng c&aacute;c h&igrave;nh thức:</p>\r\n\r\n<p>+ Đăng nhập bằng facebook</p>\r\n\r\n<p>+ Đăng nhập bằng t&agrave;i khoản đ&atilde; đăng k&yacute;</p>\r\n\r\n<p>Sau đ&oacute; bạn click button &ldquo;Bắt đầu&rdquo; để đến m&agrave;n tiếp theo&nbsp;:&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"thành chiến mobile, thanh chien mobile, game chien thuat, game chiến thuật, game nhập vai, game hành động, game tam quoc, game thủ thành, game công thành, game chiến thuật thời gian thực, game chiến lược, game chien thuat online hay nhat, game online hay nhất hiện nay\" src=\"/upload/images/djjsdsfs(1).jpg\" style=\"height:284px; width:500px\" /><br />\r\n<em>Nhấn v&agrave;o &quot; Bắt Đầu &quot; để v&agrave;o bắt đầu chơi game</em></p>\r\n\r\n<p>Những ph&uacute;t gi&acirc;y tuyệt vời c&ugrave;ng những phần qu&agrave; hấp dẫn đang chờ đ&oacute;n bạn ,h&atilde;y nhanh tay đăng k&iacute; t&agrave;i khoản để quẩy game c&ugrave;ng c&aacute;c anh em chiến hữu n&agrave;o !</p>\r\n', 'game chiến thuậtgame chien thuat mobilegame nhap vaigame nhập vai chiến thuật', 'noImage.jpg', '-hng-dn-ng-k-ng-nhp-ti-khon', 0, 9, 1, 1, '2020-05-18 17:18:56'),
(11, 3, '[TÍNH NĂNG] TRANG BỊ TƯỚNG', 'Trang bị là một phần không thể thiếu của dạng game chiến thuật. Hãy cùng nhau khám phá tính năng này nào các Chúa Công', '<p>Trang bị l&agrave; một phần kh&ocirc;ng thể thiếu của dạng game chiến thuật. H&atilde;y c&ugrave;ng nhau kh&aacute;m ph&aacute; t&iacute;nh năng n&agrave;y n&agrave;o c&aacute;c Ch&uacute;a C&ocirc;ng</p>\r\n\r\n<p><strong>1. Trang bị tướng</strong></p>\r\n\r\n<p>C&oacute; 5 loại trang bị Ch&uacute;a C&ocirc;ng&nbsp;c&oacute; thể mặc cho tướng: vũ kh&iacute;, gi&aacute;p, ấn, mũ, ngựa. Mỗi loại trang bị khi mặc cho tướng sẽ gia tăng c&aacute;c chỉ số nhất định cho tướng</p>\r\n\r\n<p>+ Vũ kh&iacute;: gia tăng chỉ số dũng v&agrave; ch&iacute; mạng cho tướng khi trang bị</p>\r\n\r\n<p>+ Gi&aacute;p: gia tăng chỉ số thống v&agrave; chống đỡ cho tướng khi trang bị</p>\r\n\r\n<p>+ Ấn: gia tăng binh lực ch&iacute; mạng, n&eacute; tr&aacute;nh, chống đỡ v&agrave; đ&aacute;nh trả cho tướng khi trang bị</p>\r\n\r\n<p>+ Mũ: gia tăng chỉ số tr&iacute; v&agrave; n&eacute; tr&aacute;nh cho tướng khi trang bị</p>\r\n\r\n<p>+ Ngựa: gia tăng chỉ số dũng, thống &nbsp;v&agrave; đ&aacute;nh trả cho tướng khi trang bị</p>\r\n\r\n<p>Ch&uacute;a c&ocirc;ng c&oacute; thể thực hiện trang bị nhanh hoặc v&agrave;o từng trang bị&nbsp;để gắn cho tướng</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/upload/images/tbtuong(1).jpg\" style=\"height:281px; width:500px\" /></p>\r\n\r\n<p>Mỗi trang bị c&oacute; sẽ 7 phẩm chất kh&aacute;c nhau: trắng, xanh lam, xanh dương, t&iacute;m, đỏ, cam. Phẩm chất trang bị c&agrave;ng cao th&igrave; gi&aacute; trị của trang bị c&agrave;ng lớn.</p>\r\n\r\n<p>Ch&uacute;a C&ocirc;ng&nbsp;c&oacute; thể nhận được trang bị theo 3 c&aacute;ch: nhận từ phụ bản, nhận từ sự kiện, mua trong shop trang bị.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/upload/images/cach%20nhan%20trang%20bi.jpg\" style=\"height:281px; width:500px\" /></p>\r\n\r\n<p><strong>2. Tăng sức mạnh cho trang bị&nbsp;</strong></p>\r\n\r\n<p>Để tăng sức mạnh cho từng trang bị Ch&uacute;a C&ocirc;ng c&oacute; thể thực hiện c&aacute;c c&aacute;ch như sau:</p>\r\n\r\n<p>- Cường h&oacute;a</p>\r\n\r\n<p>- Tiến giai</p>\r\n\r\n<p>- Khảm ngọc</p>\r\n\r\n<p>- Ph&acirc;n r&atilde;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/upload/images/cuong%20hoa.jpg\" style=\"height:281px; width:500px\" /></p>\r\n\r\n<p style=\"text-align:center\"><em>Click cường h&oacute;a sẽ tăng sức mạnh cho trang bị</em></p>\r\n\r\n<p><em>V</em>ới&nbsp;những th&ocirc;ng tin cơ bản tr&ecirc;n. BQT mong muốn sẽ gi&uacute;p một phần nhỏ trong việc c&aacute;c Ch&uacute;a C&ocirc;ng&nbsp;đi chinh phục Th&agrave;nh Chiến Mobile</p>\r\n', 'game chiến thuật, game chien thuat mobile, game nhap vai, game nhập vai, game công thành, game tam quốc', 'noImage.jpg', 'tinh-nang-trang-bi-tuong', 0, 67, 1, 1, '2020-06-03 14:00:31'),
(12, 3, '[TÍNH NĂNG] TRANG BỊ BINH CHỦNG', '', '<p><span style=\"font-size:14px\">Hiện tại trong game c&oacute;&nbsp;5 loại binh chủng: bộ binh, kỵ binh, cung binh, ph&aacute;o binh, tượng binh tương ứng với 30 binh chủng &nbsp;kh&aacute;c &nbsp;nhau. C&aacute;c &nbsp;binh chủng sẽ c&oacute; c&aacute;c chỉ số cơ bản: c&ocirc;ng, thủ v&agrave; chỉ số ẩn: N&eacute; tr&aacute;nh, Bạo k&iacute;ch, Chống đỡ, Phản k&iacute;ch, Ch&iacute;nh x&aacute;c.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img alt=\"\" src=\"/upload/images/trang-bi-binh-chung.jpg\" style=\"height:270px; width:481px\" /></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>1.&nbsp; C&aacute;c trang bị binh chủng&nbsp;</strong></span></p>\r\n\r\n<p><span style=\"font-size:14px\">Mỗi loại trang bị khi mặc cho binh chủng sẽ gia tăng c&aacute;c chỉ số nhất định cho Binh chủng.</span></p>\r\n\r\n<p><span style=\"font-size:14px\">+ Vũ kh&iacute;: tăng c&ocirc;ng thường cho Binh chủng.&nbsp;</span></p>\r\n\r\n<p><span style=\"font-size:14px\">+ Gi&aacute;p: tăng thủ thường cho Binh chủng.&nbsp;</span></p>\r\n\r\n<p><span style=\"font-size:14px\">+&nbsp; Mũ: tăng c&ocirc;ng mưu cho Binh chủng.</span></p>\r\n\r\n<p><span style=\"font-size:14px\">+ &Aacute;o cho&agrave;ng: tăng thủ mưu cho Binh chủng.</span></p>\r\n\r\n<p><span style=\"font-size:14px\">+ Huy chương: tăng binh lực cho Binh chủng.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img alt=\"\" src=\"/upload/images/trang-bi-binh-chung-1.jpg\" style=\"height:270px; width:482px\" /></span></p>\r\n\r\n<p><span style=\"font-size:14px\">Mỗi loại trang bị c&oacute; 8 phẩm chất: Trắng, xanh l&aacute; c&acirc;y, xanh da trời, v&agrave;ng, đỏ, t&iacute;m, cam, hồng. Phẩm chất trang bị c&agrave;ng cao th&igrave; gi&aacute; trị của trang bị c&agrave;ng lớn.</span></p>\r\n\r\n<p><span style=\"font-size:14px\">Những trang bị n&agrave;y nhận được từ phụ bản, mua trong shop trang bị, sự ki