(18, 3, 'TÍNH NĂNG [BANG HỘI]', '', '<p><span style=\"font-size:14px\">Bang hội ch&iacute;nh l&agrave; nơi gắn kết t&igrave;nh bằng hữu, vừa c&oacute; thể c&ugrave;ng nhau kề vai s&aacute;t c&aacute;nh vượt qua mọi thử th&aacute;ch khắc nghiệt v&agrave; chiến trường c&acirc;n n&atilde;o. V&agrave;o Bang hội người chơi sẽ nhận được rất nhiều lợi &iacute;ch, h&agrave;ng ng&agrave;y, h&agrave;ng tuần sẽ được s&aacute;t c&aacute;nh b&ecirc;n anh em bạn b&egrave; chinh phục <a href=\"https://thanhchienmobile.vn/\">Th&agrave;nh Chiến Mobile</a>&nbsp; để nhận được những phần thưởng v&agrave; qu&agrave; c&oacute; gi&aacute; trị hấp dẫn nhất.</span></p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>1. Tham gia Bang hội</strong></span></p>\r\n\r\n<p><span style=\"font-size:14px\">Để tham gia Bang hội người chơi chọn t&iacute;nh năng Bang hội hiển thị ở phần thu gọn g&oacute;c dưới b&ecirc;n phải m&agrave;n h&igrave;nh.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img alt=\"thành chiến mobile, thanh chien mobile, game chien thuat, game chiến thuật, game nhập vai, game hành động, game tam quoc, game thủ thành, game công thành, game chiến thuật thời gian thực, game chiến lược, game chien thuat online hay nhat, game online hay nhất hiện nay\" src=\"/upload/images/tinh-nang-bang-hoi.jpg\" style=\"height:276px; width:491px\" /></span></p>\r\n\r\n<p><span style=\"font-size:14px\">- Người chơi c&oacute; thể t&igrave;m c&aacute;c Bang hội hiện c&oacute; sau đ&oacute; chọn Bang m&igrave;nh th&iacute;ch rồi chọn Y&ecirc;u cầu v&agrave;o để tham gia Bang.</span></p>\r\n\r\n<p><span style=\"font-size:14px\">- Ngo&agrave;i ra, người chơi nếu kh&ocirc;ng muốn gia nhập Bang kh&aacute;c th&igrave; cũng c&oacute; thể tự tạo cho m&igrave;nh một Bang ri&ecirc;ng.</span></p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>2. C&aacute;c t&iacute;nh năng trong Bang hội</strong></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><em><strong>a. Bảng tin Bang h