(19, 1, '[GIỚI THIỆU GAME MỚI]', '', '<p><span style=\"font-size:14px\"><a href=\"https://thanhchienmobile.vn/\" style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">Th&agrave;nh Chiến Mobile</a> l&agrave; game chiến thuật Việt được lấy bối cảnh t&igrave;nh h&igrave;nh đất nước trong giai đoạn chiến tranh. Với lối chơi ho&agrave;n to&agrave;n kh&aacute;c lạ, h&igrave;nh ảnh mang đậm chất phong c&aacute;ch thuần Việt. Game được thiết kế v&agrave; ph&aacute;t triển ho&agrave;n to&agrave;n bởi đội ngũ kỹ thuật người Việt sản xuất, sử dụng đồ họa đỉnh cao kết hợp những hiệu ứng kỹ năng b&ugrave;ng nổ, hứa hẹn sẽ mang đến một trải nghiệm game chiến thuật c&acirc;n n&atilde;o v&agrave; v&ocirc; c&ugrave;ng đẹp mắt.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><iframe frameborder=\"0\" height=\"400\" scrolling=\"no\" src=\"https://www.youtube.com/embed/Vsnmxf9XyMI\" width=\"800\"></iframe></span></p>\r\n\r\n<p><span style=\"font-size:14px\">Game chiến thuật Th&agrave;nh Chiến Mobile được x&acirc;y dựng với hệ thống nh&acirc;n vật l&agrave; c&aacute;c tướng lĩnh Việt xưa n&ecirc;n bạn cảm thấy ho&agrave;n to&agrave;n quen thuộc v&agrave; gần gũi.</span></p>\r\n\r\n<p><span style=\"font-size:14px\">Th&agrave;nh Chiến Mobile l&agrave; game c&oacute; nhiều t&iacute;nh năng tương t&aacute;c đặc sắc nhất trong game chiến thuật Việt Nam. C&aacute;c hoạt động đua top trong server, c&ugrave;ng hệ thống bang hội rộng lớn được tối ưu nhằm gia tăng trải nghiệm cộng đồng cho người chơi: bang chiến, boss bang, bạn b&egrave;,...</span></p>\r\n\r\n<p><span style=\"font-size:14px\">B&ecirc;n cạnh đ&oacute;, Th&agrave;nh Chiến Mobile l&agrave; gameplay sở hữu chiến thuật turnbase kh&ocirc;ng đ&aacute;nh đơn lẻ m&agrave; người chơi c&oacute; thể phối hợp c&aacute;c đ&ograve;n đ&aacute;nh với nhau đặc sắc. C&aacute;c&nbsp;hoạt động PVE tổ đội cực hấp dẫn để chinh phục những trận đấu trong game. C&aacute;c hoạt động n&agrave;y gi&uacute;p tăn