INSERT INTO `web` (`id`, `title`, `type`, `content`, `status`) VALUES
(1, 'Điều khoản', 'dieu-khoan', '<p><strong>Điều khoản sử dụng </strong>&nbsp;</p>\r\n\r\n<p>Khi tải phần mềm về điện thoại v&agrave; đăng k&yacute; t&agrave;i khoản th&igrave; bạn đ&atilde; đồng &yacute; với c&aacute;c thỏa thuận sử dụng b&ecirc;n dưới của nh&agrave; ph&aacute;t h&agrave;nh.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1.Về t&agrave;i khoản sử dụng (account): Khi đăng k&yacute; t&agrave;i khoản, bạn n&ecirc;n cung cấp đầy đủ th&ocirc;ng tin về t&ecirc;n tuổi, địa chỉ, điện thoại, số 11CMNDN.Đ&acirc;y kh&ocirc;ng phải l&agrave; những th&ocirc;ng tin bắt buộc, nhưng khi c&oacute; những rủi ro, mất m&aacute;t sau n&agrave;y, ch&uacute;ng t&ocirc;i chỉ tiếp nhận những trường hợp điền đ&uacute;ng v&agrave; đầy đủ những th&ocirc;ng tin tr&ecirc;n.Những trường hợp điền thiếu th&ocirc;ng tin hoặc th&ocirc;ng tin sai sự thật sẽ kh&ocirc;ng được giải quyết. Những th&ocirc;ng tin n&agrave;y sẽ được d&ugrave;ng l&agrave;m căn cứ để hỗ trợ giải quyết.Nếu bạn cung cấp bất kỳ th&ocirc;ng tin n&agrave;o kh&ocirc;ng trung thực hoặc kh&ocirc;ng ch&iacute;nh x&aacute;c, hoặc nếu ch&uacute;ng t&ocirc;i c&oacute; cơ sở để nghi ngờ rằng th&ocirc;ng tin đ&oacute; kh&ocirc;ng phải l&agrave; th&ocirc;ng tin trung thực hoặc kh&ocirc;ng ch&iacute;nh x&aacute;c, ch&uacute;ng t&ocirc;i c&oacute; quyền đ&igrave;nh chỉ tạm thời để x&aacute;c minh hoặc chấm dứt việc sử dụng T&agrave;i Khoản của bạn v&agrave; từ chối to&agrave;n bộ việc sử dụng Dịch Vụ (hoặc bất kỳ phần n&agrave;o của Dịch Vụ) tại thời điểm hiện tại hoặc sau n&agrave;y m&agrave; kh&ocirc;ng phải chịu bất cứ tr&aacute;ch nhiệm n&agrave;o đối với bạn.</p>\r\n\r\n<p>2.Mật khẩu của t&agrave;i khoản (account password): Trong phần quản l&yacute; t&agrave;i khoản, đối với một t&agrave;i khoản, người chơi sẽ c&oacute; một mật khẩu v&agrave; một m&atilde; game (mật khẩu cấp 2 trước đ&acirc;y). Mật khẩu được sử dụng để đăng nhập v&agrave;o c&aacute;c game v&agrave; c&aacute;c website. M&atilde; game được sử dụng cho c&aacute;c chức năng trong một số game hoặc sử dụng để lấy lại mật khẩu. Người chơi c&oacute; tr&aacute;ch nhiệm phải tự m&igrave;nh bảo quản mật khẩu v&agrave; m&atilde; game, nếu mật khẩu hoặc m&atilde; game bị lộ ra ngo&agrave;i dưới bất kỳ h&igrave;nh thức n&agrave;o, Tr&ograve; chơi sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm về mọi tổn thất ph&aacute;t sinh.</p>\r\n\r\n<p>3.Nh&acirc;n vật (character): Với một t&agrave;i khoản c&oacute; thể tạo được nhiều nh&acirc;n vật để chơi trong tr&ograve; chơi. Khi tạo nh&acirc;n vật, bạn phải tu&acirc;n thủ theo nguy&ecirc;n tắc đặt t&ecirc;n đ&atilde; được c&ocirc;ng bố tr&ecirc;n Website của tr&ograve; chơi.</p>\r\n\r\n<p>4.Tuyệt đối kh&ocirc;ng sử dụng bất kỳ chương tr&igrave;nh, c&ocirc;ng cụ hay h&igrave;nh thức n&agrave;o kh&aacute;c để can thiệp v&agrave;o tr&ograve; chơi hay l&agrave;m thay đổi kết quả chơi b&igrave;nh thường (hack, cheat, bots). Mọi vi phạm khi bị ph&aacute;t hiện sẽ bị xử l&yacute; theo quy định của ph&aacute;p luật.</p>\r\n\r\n<p>5.Nghi&ecirc;m cấm việc ph&aacute;t t&aacute;n, truyền b&aacute; hay cỗ vũ cho bất kỳ hoạt động n&agrave;o nhằm can thiệp, ph&aacute; hoại hay x&acirc;m nhập v&agrave;o dữ liệu của tr&ograve; chơi cũng như hệ thống m&aacute;y chủ.</p>\r\n\r\n<p>6.Khi ph&aacute;t hiện ra lỗi của tr&ograve; chơi, bạn h&atilde;y th&ocirc;ng b&aacute;o cho ch&uacute;ng t&ocirc;i qua phần g&oacute;p &yacute; trong game.</p>\r\n\r\n<p>7.Kh&ocirc;ng được c&oacute; bất kỳ h&agrave;nh vi n&agrave;o nhằm đăng nhập tr&aacute;i ph&eacute;p hoặc t&igrave;m c&aacute;ch đăng nhập tr&aacute;i ph&eacute;p cũng như g&acirc;y thiệt hại cho hệ thống m&aacute;y chủ của tr&ograve; chơi. Mọi h&agrave;nh vi n&agrave;y đều bị xem l&agrave; những h&agrave;nh vi ph&aacute; hoại t&agrave;i sản của người kh&aacute;c v&agrave; sẽ tước bỏ mọi quyền lợi đối với tr&ograve; chơi cũng như sẽ bị truy tố trước ph&aacute;p luật nếu cần thiết.</p>\r\n\r\n<p>8.Kh&ocirc;ng chấp nhận việc mua b&aacute;n vật dụng hoặc t&agrave;i khoản của tr&ograve; chơi bằng tiền thật hoặc hiện kim ở trong lẫn ngo&agrave;i tr&ograve; chơi. Trong trường hợp người sử dụng vi phạm điều khoản n&agrave;y, ch&uacute;ng t&ocirc;i kh&ocirc;ng c&oacute; bất kỳ tr&aacute;ch nhiệm n&agrave;o trong việc phục hồi dồ vật hay nh&acirc;n vật. Ngo&agrave;i ra, nếu ph&aacute;t hiện những t&agrave;i khoản vi phạm ch&uacute;ng t&ocirc;i sẽ kh&oacute;a t&agrave;i khoản vĩnh viễn.</p>\r\n\r\n<p>9.Khi giao tiếp với người chơi kh&aacute;c, bạn kh&ocirc;ng được quấy rối, chửi bới, l&agrave;m phiền hay c&oacute; bất kỳ h&agrave;nh vi thiếu văn h&oacute;a n&agrave;o đối với người chơi kh&aacute;c.</p>\r\n\r\n<p>10.Tuyệt đối nghi&ecirc;m cấm việc x&uacute;c phạm, nhạo b&aacute;ng người kh&aacute;c dưới bất kỳ h&igrave;nh thức n&agrave;o (nhạo b&aacute;ng, ch&ecirc; b&aacute;i, kỳ thị t&ocirc;n gi&aacute;o, giới t&iacute;nh, sắc tộc ).</p>\r\n\r\n<p>11.Tuyệt đối nghi&ecirc;m cấm mọi h&agrave;nh vi mạo nhận hay cố &yacute; l&agrave;m người kh&aacute;c tưởng lầm m&igrave;nh l&agrave; một người chơi kh&aacute;c trong game. Mọi h&agrave;nh vi vi phạm sẽ bị xử l&yacute; hoặc tước bỏ t&agrave;i khoản.</p>\r\n\r\n<p>12.Tr&ograve; chơi ch&uacute;ng t&ocirc;i sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm đối với bất cứ vấn đề g&igrave; về hệ thống khi bạn c&agrave;i đặt v&agrave; sử dụng tr&ograve; chơi.</p>\r\n\r\n<p>13.Khi ph&aacute;t hiện những vi phạm như sử dụng cheats, hacks, hoặc những lời kh&aacute;c, Tr&ograve; chơi c&oacute; quyền sử dụng những th&ocirc;ng tin m&agrave; bạn cung cấp khi đăng k&yacute; t&agrave;i khoản để chuyển cho Cơ quan chức năng giải quyết theo quy định của ph&aacute;p luật.</p>\r\n\r\n<p>14.Trong những trường hợp bất khả kh&aacute;ng như chập điện, hư hỏng phần cứng, phần mềm, hoặc do thi&ecirc;n tai .v.v. người d&ugrave;ng phải chấp nhận những thiệt hại nếu c&oacute;.</p>\r\n\r\n<p>15.Tr&ograve; chơi c&oacute; to&agrave;n quyền x&oacute;a, sửa chữa hay thay đổi c&aacute;c dữ liệu, th&ocirc;ng tin t&agrave;i khoản trong c&aacute;c trường hợp người đ&oacute; vi phạm những qui định kể tr&ecirc;n m&agrave; kh&ocirc;ng cần sự đồng &yacute; của người sử dụng .</p>\r\n\r\n<p>16.Tuyệt đối nghi&ecirc;m cấm mọi h&agrave;nh vi tuy&ecirc;n truyền, chống ph&aacute; v&agrave; xuy&ecirc;n tạc ch&iacute;nh quyền, thể chế ch&iacute;nh trị, v&agrave; c&aacute;c ch&iacute;nh s&aacute;ch của nh&agrave; nước&hellip; Trường hợp ph&aacute;t hiện, kh&ocirc;ng những bị x&oacute;a bỏ t&agrave;i khoản m&agrave; ch&uacute;ng t&ocirc;i c&ograve;n c&oacute; thể cung cấp th&ocirc;ng tin của người đ&oacute; cho c&aacute;c cơ quan chức năng để xử l&yacute; theo ph&aacute;p luật.</p>\r\n\r\n<p>17.Tuyệt đối kh&ocirc;ng b&agrave;n luận về c&aacute;c vấn đề Ch&iacute;nh trị.</p>\r\n\r\n<p>18.Kh&ocirc;ng c&oacute; những h&agrave;nh vi, th&aacute;i độ l&agrave;m tổn hại đến uy t&iacute;n của c&aacute;c sản phẩm game cũng như c&ocirc;ng ty ph&aacute;t h&agrave;nh dưới bất kỳ h&igrave;nh thức n&agrave;o, phương thức n&agrave;o. Mọi vi phạm sẽ bị tước bỏ mọi quyền lợi li&ecirc;n quan đối với tr&ograve; chơi hoặc xử l&yacute; trước ph&aacute;p luật nếu cần thiết.</p>\r\n\r\n<p>19.Tr&ograve; chơi ho&agrave;n to&agrave;n kh&ocirc;ng chịu tr&aacute;ch nhiệm về mọi giao dịch trong tr&ograve; chơi. Ch&uacute;ng t&ocirc;i sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm về bất kỳ sự mất m&aacute;t, thiệt hại hay khiếu nại n&agrave;o li&ecirc;n quan đến việc mua b&aacute;n, trao đổi trong game.</p>\r\n\r\n<p>20.Mọi th&ocirc;ng tin c&aacute; nh&acirc;n của kh&aacute;ch h&agrave;ng sẽ được ch&uacute;ng t&ocirc;i bảo mật, kh&ocirc;ng tiết lộ ra ngo&agrave;i. Ch&uacute;ng t&ocirc;i kh&ocirc;ng b&aacute;n hay trao đổi những th&ocirc;ng tin n&agrave;y với bất kỳ một b&ecirc;n thứ ba n&agrave;o kh&aacute;c.</p>\r\n\r\n<p>21.Như tr&ecirc;n đ&atilde; n&oacute;i, mọi th&ocirc;ng tin đăng k&yacute; của th&agrave;nh vi&ecirc;n sẽ được bảo mật, nhưng trong trường hợp cơ quan chức năng y&ecirc;u cầu, ch&uacute;ng t&ocirc;i sẽ buộc phải cung cấp những th&ocirc;ng tin n&agrave;y cho c&aacute;c cơ quan chức năng.</p>\r\n\r\n<p>22.Nghi&ecirc;m cấm quảng b&aacute; bất kỳ sản phẩm n&agrave;o kh&aacute;c tr&ecirc;n game cũng như diễn đ&agrave;n m&agrave; kh&ocirc;ng c&oacute; sự đồng &yacute; bằng văn bản của Tr&ograve; chơi.</p>\r\n\r\n<p>23..Mọi vi phạm sẽ bị tước bỏ mọi quyền lợi đối với tr&ograve; chơi cũng như sẽ bị truy tố trước ph&aacute;p luật nếu cần thiết.</p>\r\n\r\n<p>24..Tr&ograve; chơi c&oacute; thể thay đổi, bổ sung hoặc sửa chưa thỏa thuận n&agrave;y bất cứ l&uacute;c n&agrave;o v&agrave; sẽ c&ocirc;ng bố r&otilde; tr&ecirc;n Website cũng như diễn đ&agrave;n.</p>\r\n\r\n<p>25.Tr&ograve; chơi c&oacute; quyền x&oacute;a c&aacute;c t&agrave;i khoản của người sử dụng nếu t&agrave;i khoản n&agrave;y kh&ocirc;ng được sử dụng để đăng nhập v&agrave;o bất cứ một sản phẩm n&agrave;o của Tr&ograve; chơi sau 30 ng&agrave;y kể từ ng&agrave;y đăng k&yacute;.</p>\r\n\r\n<p>26.Tr&ograve; chơi c&oacute; quyền x&oacute;a c&aacute;c t&agrave;i khoản của người sử dụng nếu t&agrave;i khoản n&agrave;y kh&ocirc;ng được sử dụng để đăng nhập v&agrave;o bất cứ một sản phẩm n&agrave;o của Tr&ograve; chơi trong 1 (một) năm t&iacute;nh từ lần sử dụng cuối c&ugrave;ng.</p>', 1),
